meta._wpb_post_custom_css:
.three_featured_blocks,.three_featured_blocks h3{
    color:#fff;
}

.three_featured_blocks .wpb_wrapper{
    display:grid;
    grid-template-columns:1fr 64px;
}

.three_featured_blocks .wpb_wrapper i{
    grid-column:2/3;
    grid-row:1/3;
}

.three_featured_blocks h3{
    margin-top:0;
}
a.term_block {
    border-radius: 10px;
    overflow: hidden;
    height:140px;
    font-size:24px;
}
a.term_block .term_name:after{
    content:'';
    background:rgba(255,67,103,0.8) !important;
    display:block;
    width:100%;
    height:100%;
    position: absolute;
    z-index: 1;
}
a.term_block .term_name>span{z-index:9;}

.home_counter_item {
    font-size:16px;
    font-weight:600;
    text-align:center;
    padding:30px 0;
}

.home_counter_item .numscroller{
    font-size:42px;
    color:#ff4367;
}
#home_video_text h2{font-size:48px;color:#ff4367;}
#home_video_text h2,#home_video_text{color:#fff;}
#consecutive_layer_slider .vc_column_container{margin-top:-35px;}
.block{border-radius:8px;overflow:hidden;}
.member_avatar img {
    box-shadow: 0 5px 20px rgba(0,0,0,0.2);
    border-radius: 50%;
}

.member_block3 {
    padding:15px;
    border-radius:50%;
    overflow:hidden;
}
.member_info h3 a{font-weight:600;}
.member_avatar:hover:after {border-radius:50%;}
.wplms_registration_form {
    padding: 30px;
    background: #ff4367;
    border-radius: 5px;
    box-shadow: 0 5px 20px rgba(0,0,0,0.2);
    color: #fff;
}

.wplms_registration_form legend, .wplms_registration_form label{
    border:none;
    font-size:16px;
    color:#fff;margin:0 0 10px
}

.wplms_registration_form input{
    width:100%;
    border-radius:5px;
    border:2px solid rgba(255,255,255,0.2);
}.wplms_registration_form li+li{
    margin-top:30px;
    display:inline-block;
    width:100%;
}
.g-recaptcha{
    margin-top:30px;
}.vibe_countdown{text-align:left !important;}

